import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Prog extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: "",
    };
  }
  render() {
    return (
      <div>
        <form>
          <input
            placeholder="Enter your text"
            onChange={(e) => this.setState({ data: e.targe.value })}
          ></input>
          <h1>{this.state.data}</h1>
        </form>
      </div>
    );
  }
}
export default Prog;

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Prog />);
